func kill(args []string) error {
	cArgs := []string{
		"Stop-Process",
	}

	cArgs = append(cArgs, args...)

	cmd := exec.Command("powershell", cArgs...)

	cmd.Stderr = os.Stderr
	cmd.Stdout = os.Stdout

	return cmd.Run()
}

