func parsePSOut(out []byte) map[string][]string {
	temp := []byte{}
	temp2 := []byte{}
	strs := []string{}
	var j byte = 0

	// убрать множественные пробелы подряд
	for i := 0; i < len(out)-1; i++ {
		if out[i] == 32 && j != 32 {
			j = 32
			temp2 = append(temp2, out[i])
			continue
		}

		if out[i] != 32 && j == 32 {
			j = 0
			temp2 = append(temp2, out[i])
			continue
		}

		if out[i] != 32 && j != 32 {
			temp2 = append(temp2, out[i])
			continue
		}
	}

	// разбить строку по переносу строки
	for i := 0; i < len(temp2)-1; i++ {
		if temp2[i] == 13 && temp2[i+1] == 10 && len(temp) != 0 {
			strs = append(strs, string(temp))
			temp = []byte{}
		}
		temp = append(temp, temp2[i])

	}

	for i, v := range strs {
		fmt.Println("I:", i, []byte(v))
		fmt.Println("I:", i, v)
	}

	strs = strs[2 : len(strs)-1]

	for i, v := range strs {
		s := []byte(v)
		// fmt.Println(s[4 : len(s)-2])
		strs[i] = string(s[4 : len(s)-1])
		fmt.Println("I:", i, []byte(v))
		fmt.Println("I:", i, v)
	}

	for i, v := range strs {
		fmt.Println("I:", i, []byte(v))
		fmt.Println("I:", i, v)
	}

	return nil
}

